import func , {_tasks} from './componentes/functions.js';
import Header from './componentes/Header.js';

// CODIGO

var tasksRecivied = func.call(_tasks);

export default function App() {

  return (

    <View style={{width: '100%', height: '100%', backgroundColor: '#CCC'}}>

      <Header ></Header>

      {
        tasksRecivied.map((valor)=>{
          return(
            <View style={{width: 100, height: 100, backgroundColor: 'blue'}}key={valor.key}>
              <Text style={{color: 'black'}}>
                {
                  valor.task
                }
              </Text>
            </View>
          )

        })

      }

    </View>

  );
}
